import React from "react"
import { View, Text } from "react-native"

const IndexPage: React.FC = () => {
  return (
    <>
      <View style={{ backgroundColor: "green" }}>
        <Text>Hello World</Text>
      </View>
    </>
  )
}

export default IndexPage
